import React from 'react';
import { Link }  from 'react-router-dom';
import 'animate.css';

let vid = document.getElementById("myVideo");
function playVid() {
  vid.play();
	vid.autoplay = true;
	document.getElementById("myVideo").load();

}

function myFunction() {
  document.getElementById("myVideo").load();
}


export default () => (
	<div className='landing'>
		<div className='info'>

<video id="myVideo"  >
		<source width="100rem" height="100%"  src="https://www.learningcontainer.com/bfd_download/sample-mp4-file/" allow="autoplay" id="audio" type="video/mp4">
						</source>
</video>
<iframe id="myVideo" width="100%" height="100%" marginheight="0" frameborder="0" border="0" scrolling="auto" onload="autoResize(this);" src="https://www.learningcontainer.com/bfd_download/sample-mp4-file/" onloadedmetadata="this.autoplay = true" allow="autoplay" id="audio" allowfullscreen >	</iframe>



		<h2>
		New Wave
		</h2>
		<h3>Property Group</h3>
			<p class="animated fadeInUp">We take your dream home and make it real.</p>
			<Link to='/contactpage'>
			<button className="button1">BOOK YOUR CONSULTATION</button>
			</Link>

		</div>
	</div>
);
